script: |
  super -f text -I q10385.spq | sort > q10385.out

inputs:
  - name: q10385.spq
    data: |
      SELECT ALL + tab1.col0 * col0 AS col1 FROM tab1 (FORMAT parquet) WHERE + col2 * - col1 - - col0 NOT IN ( - col2 + col0 );
  - name: tab1

outputs:
  - name: q10385.out
    data: |
      4096
      6400
      9
